import { useNavigate } from "react-router-dom";

const Banner = () => {
    const navigate =  useNavigate();
    return(
        <div>
            <h3>Banner Page</h3>
            <button onClick={()=> navigate('/about')}>Banner</button>
        </div>
    )
};
export default Banner;
